import { library } from "@fortawesome/fontawesome-svg-core";

import {
  faFileAlt,
  faFileInvoice,
  faCog,
  faUserPlus,
} from "@fortawesome/pro-light-svg-icons";

library.add(faFileAlt, faFileInvoice, faCog, faUserPlus);

export default library;
